import './App.css';
import Cell from './components/Cell'

function App() {
  const matrixObject = []

  for (let i = 0; i < 8; i++) {
    matrixObject.push([])
    for (let k = 1; k < 8; k++) {
      matrixObject[i].push(k)
    }
  }

  // console.log(matrixObject)

  return (
    <div className="App">
      <header className="App-header">
        {matrixObject.map((el, i) =>
          el.map(e =>
            <Cell
              widthLineNumber={e}
              heightLineNumber={i}
            />
          )
        )
        }

      </header >
    </div >
  );
}

export default App;
